import React from 'react';
import Cards from './cards';
import { Context } from '../../pages/MainPage/MainPage';


function PizzaCard() {
  const { setCards,  } = React.useContext(Context)

  React.useEffect(() => {
    fetch('https://64c970ddb2980cec85c23f10.mockapi.io/PizzaCard')
    .then((response) => response.json())
    .then((data) => {
        setCards(data);
    });
  }, []);

  return (
    <div>
      <Cards />
    </div>
  )
}

export default PizzaCard
